import React from 'react'
import MainNav from "../components/MainNav"
import SecNav from '../components/SecNav'
import "../stylesheets/navbar.css"

export default function Navbar() {
    const SEC_NAV_DATA=[{title:"New",path:'/neworders'},{title:"Confirmed",path:"confirmedorders"},{title:"Cancelled",path:"/cancelledorders"},{title:"Shipped",path:"/shippedorders"},{title:"Returned",path:"/returnedorders"},{title:"Replaced",path:"replacedorders"},{title:"Failed",path:"failedorders"}]
    return (
        <div>
            <MainNav/>
            <SecNav data={SEC_NAV_DATA}/>
        </div>
    )
}
